import React from "react"
export default function App()
{
    const [value, setValue] = React.useState("Previous value");
    function changeValue()
    {
        setValue("New value");
    }

    return(
        <div>
             <h1>
                {value}
            </h1>
            <button onClick={changeValue}>Click Me!</button>
        </div>
    );
}
